import request from '../utils/request'
export const registerAPI = () => request({
  url: '/api/reguser',
  method: 'post',
  body: {
    username: '13291816657',
    password: '88888888'
  }
})
export const loginAPI = (data) => request({ url: '/my/login', method: 'post', data })
